subroutine astrosil(l_lnk,n_lnk,k_lnk,nlam,rho)
  ! Created by ingesting lnk_data/astrosil-Draine2003.lnk
  ! "Astronomical Silicate"
  ! Reference: Draine 2003, ApJ 598, 1017
  ! Material is basically MgFeSiO4, but constants are smoothed
  ! and partially constructed
  !
  ! Name:       Astronomical silicate
  ! Class:      Silicates
  ! State:      amorphous
  ! Formula:    MgFeSiO_{4}
  ! ADS-link:   https://ui.adsabs.harvard.edu/abs/2003ApJ...598.1017D
  ! BibTeX-key: 2003ApJ...598.1017D
  !

  IMPLICIT NONE
  integer nlam,j
  real*8 l_lnk(*),n_lnk(*),k_lnk(*)
  real*8 l0(837),n0(837),k0(837)
  real*8 rho
  nlam = 837
  rho  = 3.3
  data (l0(j),j=1,837) / &
  6.199200e-05,6.525474e-05,6.888000e-05,7.293177e-05,7.749000e-05, &
  8.265600e-05,8.856000e-05,9.537231e-05,1.033200e-04,1.127127e-04, &
  1.239840e-04,1.305095e-04,1.377600e-04,1.408909e-04,1.441674e-04, &
  1.476000e-04,1.512000e-04,1.549800e-04,1.569418e-04,1.589538e-04, &
  1.610182e-04,1.631369e-04,1.653120e-04,1.675459e-04,1.698411e-04, &
  1.717230e-04,1.719612e-04,1.722000e-04,1.723197e-04,1.724395e-04, &
  1.725595e-04,1.726797e-04,1.728000e-04,1.729205e-04,1.730412e-04, &
  1.731620e-04,1.732830e-04,1.734042e-04,1.735256e-04,1.736471e-04, &
